// src/pages/member/MemberDashboard.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './MemberDashboard.css';

const MemberDashboard = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    monthlyContribution: 5000,
    totalPaid: 45000,
    pendingAmount: 5000,
    lastPaymentDate: '1/10/2025',
    myComplaints: 3,
    unreadNotifications: 5
  });
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    setLoading(true);
    setTimeout(() => {
      setStats({
        monthlyContribution: 5000,
        totalPaid: 45000,
        pendingAmount: 5000,
        lastPaymentDate: '1/10/2025',
        myComplaints: 3,
        unreadNotifications: 5
      });
      setLoading(false);
    }, 1000);
  }, []);

  const handleViewExpenses = () => {
    navigate('/member/expenses');
  };

  const handleViewComplaints = () => {
    navigate('/member/complaints');
  };

  const handleViewNotifications = () => {
    navigate('/member/notifications');
  };

  const formatAmount = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      minimumFractionDigits: 0
    }).format(amount);
  };

  if (loading) {
    return (
      <div className="member-dashboard">
        <div className="loading-container">
          <div className="spinner"></div>
        </div>
      </div>
    );
  }

  return (
    <div className="member-dashboard">
      <div className="dashboard-header">
        <h1>Member Dashboard</h1>
        <p>Welcome back! Red Valley Apartment</p>
      </div>

      <div className="welcome-section">
        <h3>Hello, Resident!</h3>
        <p>Manage your contributions and stay updated with community news</p>
      </div>

      <div className="dashboard-cards">
        <div className="dashboard-card">
          <div className="card-icon">
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#3b82f6">
              <path d="M5,6H23V18H5V6M14,9A3,3 0 0,1 17,12A3,3 0 0,1 14,15A3,3 0 0,1 11,12A3,3 0 0,1 14,9M9,8A2,2 0 0,1 7,10V14A2,2 0 0,1 9,16H19A2,2 0 0,1 21,14V10A2,2 0 0,1 19,8H9M1,10H3V20H19V22H1V10Z"/>
            </svg>
          </div>
          <div className="card-content">
            <h3>Monthly Contribution</h3>
            <p>{formatAmount(stats.monthlyContribution)}</p>
            <p className="card-subtitle">Due on 1st of each month</p>
          </div>
        </div>
        
        <div className="dashboard-card">
          <div className="card-icon">
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#10b981">
              <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M11,16.5L6.5,12L7.91,10.59L11,13.67L16.59,8.09L18,9.5L11,16.5Z"/>
            </svg>
          </div>
          <div className="card-content">
            <h3>Total Paid</h3>
            <p>{formatAmount(stats.totalPaid)}</p>
            <p className="card-subtitle">This year</p>
          </div>
        </div>
        
        <div className="dashboard-card">
          <div className="card-icon">
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#f59e0b">
              <path d="M13,13H11V7H13M13,17H11V15H13M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2Z"/>
            </svg>
          </div>
          <div className="card-content">
            <h3>Pending Amount</h3>
            <p>{formatAmount(stats.pendingAmount)}</p>
            <p className="card-subtitle">Due this month</p>
          </div>
        </div>
        
        <div className="dashboard-card">
          <div className="card-icon">
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#ef4444">
              <path d="M14,2H6A2,2 0 0,0 4,4V20A2,2 0 0,0 6,22H18A2,2 0 0,0 20,20V8L14,2M18,20H6V4H13V9H18V20M12,11L8,15H10.5V18H13.5V15H16L12,11Z"/>
            </svg>
          </div>
          <div className="card-content">
            <h3>My Complaints</h3>
            <p>{stats.myComplaints}</p>
            <p className="card-subtitle">1 resolved, 2 pending</p>
          </div>
        </div>
        
        <div className="dashboard-card">
          <div className="card-icon">
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#8b5cf6">
              <path d="M21,19V20H3V19L5,17V11C5,7.9 7.03,5.17 10,4.29C10,4.19 10,4.1 10,4A2,2 0 0,1 12,2A2,2 0 0,1 14,4C14,4.1 14,4.19 14,4.29C16.97,5.17 19,7.9 19,11V17L21,19M14,21A2,2 0 0,1 12,23A2,2 0 0,1 10,21"/>
            </svg>
          </div>
          <div className="card-content">
            <h3>Unread Notifications</h3>
            <p>{stats.unreadNotifications}</p>
            <p className="card-subtitle">Latest updates</p>
          </div>
        </div>
        
        <div className="dashboard-card">
          <div className="card-icon">
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#06b6d4">
              <path d="M19,3H14.82C14.4,1.84 13.3,1 12,1C10.7,1 9.6,1.84 9.18,3H5A2,2 0 0,0 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5A2,2 0 0,0 19,3M12,3A1,1 0 0,1 13,4A1,1 0 0,1 12,5A1,1 0 0,1 11,4A1,1 0 0,1 12,3M7,7H17V5H19V19H5V5H7V7Z"/>
            </svg>
          </div>
          <div className="card-content">
            <h3>Last Payment</h3>
            <p>{stats.lastPaymentDate}</p>
            <p className="card-subtitle">Paid on time</p>
          </div>
        </div>
      </div>
      
      <div className="quick-actions-section">
        <h2>Quick Actions</h2>
        <div className="quick-actions-container">
          <button 
            className="quick-action-btn"
            onClick={handleViewComplaints}
          >
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
              <path d="M14,2H6A2,2 0 0,0 4,4V20A2,2 0 0,0 6,22H18A2,2 0 0,0 20,20V8L14,2M18,20H6V4H13V9H18V20Z"/>
            </svg>
            View Complaints
          </button>
          
          <button 
            className="quick-action-btn expenses-btn"
            onClick={handleViewExpenses}
          >
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
              <path d="M19,3H14.82C14.4,1.84 13.3,1 12,1C10.7,1 9.6,1.84 9.18,3H5A2,2 0 0,0 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5A2,2 0 0,0 19,3M12,3A1,1 0 0,1 13,4A1,1 0 0,1 12,5A1,1 0 0,1 11,4A1,1 0 0,1 12,3M7,7H17V5H19V19H5V5H7V7Z"/>
            </svg>
            View Expenses
          </button>
          
          <button 
            className="quick-action-btn"
            onClick={handleViewNotifications}
          >
            <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
              <path d="M21,19V20H3V19L5,17V11C5,7.9 7.03,5.17 10,4.29C10,4.19 10,4.1 10,4A2,2 0 0,1 12,2A2,2 0 0,1 14,4C14,4.1 14,4.19 14,4.29C16.97,5.17 19,7.9 19,11V17L21,19M14,21A2,2 0 0,1 12,23A2,2 0 0,1 10,21"/>
            </svg>
            View Notifications
          </button>
        </div>
      </div>
    </div>
  );
};

export default MemberDashboard;
